const Todo = ({todo, handleToggle}) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  }

  return (
      <div  onClick={handleClick} className={todo.complete ? "todo strike" : "todo"}>
        {todo.task}
      </div>
  );
}

export default Todo;
